css:
.atom-runner {
  background: #2c3e50;
  padding: 10px;
  overflow-y: scroll;
  color: #ecf0f1;
}
.atom-runner pre {
  background-color: #d3d9da;
  padding: 15px;
}
.atom-runner pre .stderr {
  color: #c62b2b;
}
.atom-runner .footer {
  color: #ecf0f1;
  padding-top: 15px;
  word-break: break-word;
}
